    <div className="home" style={{ backgroundImage: `url(${BannerImage})` }}>
      <div className="headerContainer" >
        <h1> Mortgage Money Control </h1>
        <p> Select suitable motgage products</p>
        <Link to="/FactFind">
          <button > APPLY NOW </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
